import './App.css';
import Login from './Login'; // Import your Login component
import Lottie from "lottie-react";
import testanimation from "./testanimation.json";

const App = () => (
    <div> {/* Single parent element */}
        <div style={{ width: '300px', height: '300px' }}> {/* Set the size for Lottie animation */}
            <Lottie animationData={testanimation} loop={true} />
        </div>
        <div> {/* Container for the Login component */}
            <Login />
        </div>
    </div>
);
export default App;
